import { Link,Route} from 'react-router-dom';
import Timer from './Timer';

function App() {
  return (
    <div>
      
      <Link to="/Timer">타이머</Link>
      <Route path="/timer" exact={true} component={Timer} />
    </div>
  );
}

export default App;
